import React from "react";
import "tailwindcss/tailwind.css";
import home from "../../Images/home.svg";
import menu from "../../Images/menu.svg";
import search from "../../Images/search.svg";

const Header = () => {
  return (
    <header className=" drop-shadow-lg fixed top-0 left-0 w-full p-5 bg-slate-300 flex items-center justify-between">
      {/* left side */}
      <div className="flex">
        <img src={menu} alt="menu" className="w-6 h-6 object-contain" />
        <h4 className="ml-4">LearnS</h4>
        <div className="flex">
          <input type="text" placeholder="Search" />
          <img src={search} alt="search" className="w-6 h-6 object-contain" />
        </div>
      </div>
      {/* right side */}
      <img src={home} alt="home" className="w-6 h-6 object-contain" />
    </header>
  );
};

export default Header;
